package org.string;

public class FailThru {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i  = args.length;
		switch(i)
		{
		case 1: System.out.println(0);
		case 2: System.out.println(0);
		case 3: System.out.println(0);
		case 4: System.out.println(0);
		case 5: System.out.println(0);
		default:System.out.println(0);
		}
		

	}

}
